import React from 'react';

const Home = () => {
  return (
    <div className="container mt-5">
      <div className="p-5 mb-4 bg-light rounded-3">
        <div className="container-fluid py-5">
          <h1 className="display-5 fw-bold">Chào mừng đến với Trang Quản lý Giải Bóng Đá</h1>
          <p className="col-md-8 fs-4">Sử dụng thanh điều hướng để truy cập các chức năng.</p>
        </div>
      </div>
    </div>
  );
};

export default Home;
